const heading = {
  color: '#fb2525',
  textAlign: 'center',
  textTransform: 'capitalize',
  fontWeight: 'bold',
  textShadow: '0px 2px 4px #ff772a',
  margin: '50px 0'
}
ReactDom.render(
  <>
   <h1 className="heading">My name is Mukesh</h1>
   <div className="img_div">
    <img src={img1} alt="randomimage" />
    <img src={img2} alt="randomimage" />
    <a href={home} target="_jay">
      <img src={img3} alt="randomimage" />
    </a>
   </div>
  </>,
  document.getElementById("root")
);
